import React from 'react';
import SvgIcon from '@components/svgIcon/SvgIcon';
import { theme } from '@styles/theme/theme';
import { Contact } from './ContactSection.styles';

const ContactSection = () => {
  return (
    <Contact>
      a
      <SvgIcon src="/assets/static/icons/instagram.svg" height="20px" width="20px" fill={theme.colors.black8} />
    </Contact>
  );
};

export default ContactSection;
